const chai = require('chai');
const chaiHttp = require('chai-http');
const faker = require('faker');
const mongoose = require('mongoose');
const bcrypt = require('bcryptjs');
const passport = require('passport');
const {jwtStrategy}= require("../server.js");
passport.use(jwtStrategy);
const jwt = require('jsonwebtoken');
const {JWT_SECRET} = require('../config');

// this makes the should syntax available throughout
// this module
const should = chai.should();

const {Business} = require('../models');
const {app, runServer, closeServer} = require('../server');
const {TEST_DATABASE_URL} = require('../config');


chai.use(chaiHttp);
function seedBusinessData() {
var promiseArray = [];
  for (let i=1; i<=10; i++) {
 promiseArray.push(createBusinessData());
  }
  // this will return a promise
  return Promise.all(promiseArray);
}

function createBusinessData(){
         var newBusiness =generateBusinessData();
      var username=newBusiness.username;
      var name = newBusiness.name;
      var address = newBusiness.address;
      return Business.hashPassword(newBusiness.password).then(password=>
      Business.create({
          username,
          password,
          name,
          address
      })
      );
    
}

// can be used to generate seed data for db
// or request.body data
function generateBusinessData() {
  return {
    username: faker.internet.userName(),
    password: faker.internet.password(),
    name: faker.company.companyName(),
    address:{
        street: faker.address.streetAddress(),
        city: faker.address.city(),
        state: faker.address.state(),
        zip: faker.address.zipCode()
    }
  };
}


// this function deletes the entire database.
// we'll call it in an `afterEach` block below
// to ensure  ata from one test does not stick
// around for next one
function tearDownDb() {
    console.warn('Deleting database');
    return mongoose.connection.dropDatabase();
}

describe('Religious Tolerance Pledge', function() {
    before(function() {
        return runServer(TEST_DATABASE_URL);
    });
 beforeEach(function() {
    return seedBusinessData();
  });

  afterEach(function() {
    return tearDownDb();
  });
    after(function() {
        return closeServer();
    });
            it('Should return status 200 when accessing index.html', function() {
                return chai.request(app).get('/').then(res => {
                    res.should.have.status(200);
                });
            });
            it('Should return status 200 when accessing certificate.html', function() {
                return chai.request(app).get('/certificate.html').then(res => {
                    res.should.have.status(200);
                });
            });
            it('Should return status 200 when accessing why.html', function() {
                return chai.request(app).get('/why.html').then(res => {
                    res.should.have.status(200);
                });
            });
            it('Should return status 200 when accessing list.html', function() {
                return chai.request(app).get('/list.html').then(res => {
                    res.should.have.status(200);
                });
    });
    it ('Should return list of businesses at /businesses',function(){
                        let resBusiness;
                return chai.request(app).get('/businesses').then(res => {
                    res.should.have.status(200);
                    res.should.be.json;
                    res.body.should.be.a('array');
                    res.body.should.have.length.of.at.least(1);
                    res.body.forEach(function(business) {
            business.should.be.a('object');
            business.should.include.keys(
              '_id', 'username', 'password', 'name','address');
          });
         resBusiness = res.body[0];
          return Business.findById(resBusiness._id);
        })
        .then(function(business) {

          resBusiness._id.should.equal(business._id.toString());
          resBusiness.username.should.equal(business.username);
          resBusiness.password.should.equal(business.password);
          resBusiness.name.should.equal(business.name);
          resBusiness.address.street.should.equal(business.address.street);
          resBusiness.address.city.should.equal(business.address.city);
          resBusiness.address.state.should.equal(business.address.state);
          resBusiness.address.zip.should.equal(business.address.zip);
        });
    });

            it('Should return status 200 when accessing ask.html', function() {
                return chai.request(app).get('/ask.html').then(res => {
                    res.should.have.status(200);
                });
            });
    it('should add a new business', function() {

      const newBusiness = generateBusinessData();

      return chai.request(app)
        .post('/businesses')
        .send(newBusiness)
        .then(function(res) {
          res.should.have.status(201);
          res.should.be.json;
          res.body.should.be.a('object');
          res.body.should.include.keys('business', 'token');
          res.body.business.username.should.equal(newBusiness.username);
          // cause Mongo should have created id on insertion
          res.body.business._id.should.not.be.null;
          res.body.business.name.should.equal(newBusiness.name);
          res.body.business.address.street.should.equal(newBusiness.address.street);
          res.body.business.address.city.should.equal(newBusiness.address.city);
          res.body.business.address.state.should.equal(newBusiness.address.state);
          res.body.business.address.zip.should.equal(newBusiness.address.zip);
          return bcrypt.compare(newBusiness.password, res.body.business.password)
          .then((res)=>{
          res.should.be.true;
          });
        });
    });
    it('Should return a valid auth token when correct credentials are given to /login', function() {
        let user = generateBusinessData();
        return Business.hashPassword(user.password)
        .then(password=>
        Business.create({
            username: user.username,
            password: password,
            name: user.name,
            address: user.address
        })
            .then(function(){
            return chai
                .request(app)
                .post('/login')
                .auth(user.username, user.password)
                .then(res => {
                    res.should.have.status(200);
                    res.body.should.be.an('object');
                    const token = res.body.token;
                    token.should.be.a('string');
                    const payload = jwt.verify(token, JWT_SECRET, {
                        algorithm: ['HS256']
                    });
                    payload.user.should.contain({
                        username: user.username,
                        password: password,
                        name: user.name,
                    });
                });
        }));
        });
         it('Should send protected data at /certificate', function() {
         
            let user = generateBusinessData();
        return Business.hashPassword(user.password)
        .then(password=>
        Business.create({
            username: user.username,
            password: password,
            name: user.name,
            address: user.address
        })
            .then(function(){
                const token = jwt.sign({user}, JWT_SECRET, {
                        subject: user.username,
                        expiresIn: '7d',
                        algorithm: 'HS256'
                    });

                return chai
                .request(app)
                .get('/certificate')
                .set('authorization', `Bearer ${token}`)
                .then(res => {
                    res.should.have.status(200);
                    res.body.should.equal("<img src = 'data:image/png;base64,'/>");
                });
            })
        );
         });
})